def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num ** 0.5) + 1):
        if num % i == 0:
            return False
    return True
def prime_generator(limit):
    num = 2
    while num < limit:
        if is_prime(num):
            yield num
        num += 1

prime_gen = prime_generator(1000)
print("First 20 prime numbers:")
for _ in range(20):
    print(next(prime_gen))

