 /*.page-read .entry-content blockquote,.page-network .entry-content blockquote{background:#eee;padding:1.5em;margin:2em 0 2em 0}*/
/*end Misc. Entry Content*/

.metadata{clear:both;margin:-1.5em 0 0 0}
.metadata:not(*:root){margin:0 0 0 0}
.metadata,.tag{font-size:.95em;font-weight:bold}
.metadata-label,.tag-text{text-transform:uppercase}
