vector < int > freq(21) ;
const int N = 1005;
vector < vector < int > > dp( N, vector <int> ( 21 ,-1));



int rec(int curr , int last ){
    
    if(curr <= 0 or last >= 21) return !curr ;
    int& ret = dp[curr][last];
    if(~ret) return ret ;
    ret =0;
    if( curr-last >=0 and freq[last] > 0){
        ret+= rec(curr-last , last);
        freq[last]--;
    }

    ret+= rec(curr , last+1);
    return ret ;
}


