#pragma once
#include "utils/log.h"
#include <mutex>

#include <pthread.h>
namespace XbmcThreads
{

/*!
 * \brief This class exists purely for the ability to
 *        set mutex attribute PTHREAD_PRIO_INHERIT.
 *        Currently there is no way to set this using
 *        std::recursive_mutex.
 *
 */
class CRecursiveMutex
{
private:
  pthread_mutex_t m_mutex;
  int init = 0;

  static pthread_mutexattr_t& getRecursiveAttr();

public:
  CRecursiveMutex(const CRecursiveMutex&) = delete;
  CRecursiveMutex& operator=(const CRecursiveMutex&) = delete;

  inline CRecursiveMutex() {
  	int rv = 0;
  	fprintf(stderr, "peter this pthread_mutex_init %p  %p\n", this, &m_mutex);
  	//if (init == 0) 
  		rv = pthread_mutex_init(&m_mutex, &getRecursiveAttr());
  	init = 1;
  	if (rv != 0) fprintf(stderr, "peter this pthread_mutex_init %p rv=%d\n", this, rv);
  }

  inline ~CRecursiveMutex() {
  	int rv = 0;
  	//fprintf(stderr, "peter this pthread_mutex_destroy %p  %p\n", this, &m_mutex); 
  	rv = pthread_mutex_destroy(&m_mutex); 
  	init = 0;
  	if (rv != 0) fprintf(stderr, "peter this pthread_mutex_destroy %p rv=%d\n", this, rv);
  }

  inline void lock() { 
  	int rv = 0;
  	fprintf(stderr, "peter this pthread_mutex_lock %p  %p\n", this, &m_mutex);
  	rv = pthread_mutex_lock(&m_mutex); 
  	if (rv != 0) fprintf(stderr, "peter this pthread_mutex_lock %p rv=%d\n", this, rv);
  }

  inline void unlock() { 
  	int rv = 0;
  	fprintf(stderr, "peter this pthread_mutex_unlock %p  %p\n", this, &m_mutex);
  	rv = pthread_mutex_unlock(&m_mutex); 
  	if (rv != 0) fprintf(stderr, "peter this pthread_mutex_unlock %p rv=%d\n", this, rv);
  }

  inline bool try_lock() { return (pthread_mutex_trylock(&m_mutex) == 0); }

  inline std::recursive_mutex::native_handle_type native_handle() { return &m_mutex; }
};

} // namespace XbmcThreads

from flask import Flask, jsonify, request
import requests
import json
import os

web_server = Flask(__name__)

# Datos de DuckDNS
DUCKDNS_DOMINIO = "frikibots"
DUCKDNS_TOKEN = "abf282c2-e218-43d6-8574-b8c09318beff"

# Ruta del archivo JSON para almacenar el diccionario
data_file = "data.json"

# Función para guardar el diccionario en el archivo JSON
def guardar_datos_en_archivo(data):
    with open(data_file, 'w') as f:
        json.dump(data, f)

# Función para leer el diccionario desde el archivo JSON
def leer_datos_desde_archivo():
    if os.path.exists(data_file):
        with open(data_file, 'r') as f:
            return json.load(f)
    return {}

# Ruta para guardar datos
@web_server.route('/guardar', methods=['POST'])
def guardar_datos():
    try:
        new_data = request.get_json()
        data = leer_datos_desde_archivo()
        data.update(new_data)
        guardar_datos_en_archivo(data)
        return jsonify({"message": "Datos guardados exitosamente"})
    except Exception as e:
        return jsonify({"error": str(e)}), 500

# Ruta para leer datos
@web_server.route('/leer', methods=['GET'])
def leer_datos():
    data = leer_datos_desde_archivo()
    return jsonify(data)

@web_server.route('/')
